const inititalState = {
    inPerson: 'in person'
}

const inPerson = (state = inititalState, action) => {
    console.log('======', action)
    switch (action.type) {
      case 'CHANGE_INPERSON':
        return {
          ...state,
          inPerson: action.inPerson.mode
        }
      default:
        return state;
    }
}

export default inPerson;
